import React, { useState } from 'react';
import { Text, StyleSheet,View, Button, TextInput, Image, TouchableOpacity} from "react-native";
import { styles } from '../Style/style';



export default function Dados({navigation}){

    const [dados, setDados] = useState({
        agencia:'',
        contaCorrente:'',
        valor:0,
        resultado:0,
    });
    return (
        <View style={styles.dados}>

            <View>
            <Image source={require('../../img/logo.png')}/>
            </View>
           
            <Text style={styles.dadosText}>Dados para Depósito</Text>

            <View style={styles.form}>

                <Text style={styles.formText1}>Agência:</Text>

                <TextInput style={styles.formInput} placeholder='Digite sua agência' keyboardType="numeric"/>

            </View>

            
            <View style={styles.form}>

                <Text style={styles.formText1}>Conta Corrente:</Text>

                <TextInput style={styles.formInput}  placeholder='Digite sua Conta'  keyboardType="numeric" defaultValue={dados.contaCorrente} onChangeText={(valor) => setDados ({...dados, contaCorrente:valor})}/>

            </View>

            

      

            <Text style={styles.dadosText1}>{`\nAgência Bancária: ${dados.agencia}`}</Text>

            <Text style={styles.dadosText1}>{`\nConta: ${dados.contaCorrente}`}</Text>

            <TouchableOpacity title="Login"
                        onPress={() => navigation.navigate('Form')}/>
            <TouchableOpacity style={styles.dadosTouch}  onPress={() => navigation.navigate ('Cash')}>
                    <View><Text style={styles.dadosTouchText}>Login</Text></View></TouchableOpacity> 


            
        </View>
    )
}
